import React from "react";
import { useState, useEffect } from "react";
import { OutlinedInput, InputLabel, Button } from "@mui/material";
import axios from "axios";

function UserSearchBox({ baseURL }) {
  const [keyword, setKeyword] = useState("");
  console.log(baseURL);
  const clickHandler = () => {
    try {
      axios
        .get(`${baseURL}/searchFriends/${keyword}`)
        .then((response) => {
          console.log(response.data);
        })
        .catch((error) => {
          console.log(error);
        });
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="searchBox">
      <OutlinedInput
        error={false}
        id="searchBox-keywword"
        label="serach"
        value={keyword}
        placeholder="Search for a user..."
        onChange={(event) => {
          setKeyword(event.target.value);
        }}
        data-testid="addNewPost-postTitle"
      />
      <Button variant="contained" size="small" onClick={clickHandler}>
        Search
      </Button>
    </div>
  );
}

export default UserSearchBox;
